import React, { useState } from 'react';
import {
  Box,
  Tabs,
  Tab,
  Paper,
  Button,
  CircularProgress,
  Alert,
  Snackbar,
} from '@mui/material';
import {
  Settings as SettingsIcon,
  Email as EmailIcon,
  Palette as PaletteIcon,
  CalendarToday as CalendarIcon,
  VpnKey as VpnKeyIcon,
  Code as CodeIcon,
  Info as InfoIcon,
} from '@mui/icons-material';
import { useApp } from '../context/AppContext';
import PageHeader from '../components/PageHeader';
import GeneralSettings from '../components/settings/GeneralSettings';
import EmailSettings from '../components/settings/EmailSettings';
import AppearanceSettings from '../components/settings/AppearanceSettings';
import CalendarIntegration from '../components/settings/CalendarIntegration';
import LicenseSettings from '../components/settings/LicenseSettings';
import AdvancedSettings from '../components/settings/AdvancedSettings';
import SystemInfo from '../components/settings/SystemInfo';

function TabPanel({ children, value, index, ...other }) {
  return (
    <Box
      role="tabpanel"
      hidden={value !== index}
      id={`settings-tabpanel-${index}`}
      aria-labelledby={`settings-tab-${index}`}
      {...other}
      sx={{ py: 3 }}
    >
      {value === index && children}
    </Box>
  );
}

const Settings = () => {
  const [activeTab, setActiveTab] = useState(0);
  const [saving, setSaving] = useState(false);
  const [settings, setSettings] = useState({
    // Initial settings state
    general: {},
    email: {},
    appearance: {},
    calendar: {},
    license: {},
    advanced: {},
  });
  const { showNotification } = useApp();

  const handleTabChange = (event, newValue) => {
    setActiveTab(newValue);
  };

  const handleSettingsUpdate = (section, newSettings) => {
    setSettings((prev) => ({
      ...prev,
      [section]: newSettings,
    }));
  };

  const handleSaveSettings = async () => {
    try {
      setSaving(true);
      // TODO: Implement settings save through WordPress REST API
      await new Promise((resolve) => setTimeout(resolve, 1000)); // Simulated delay
      showNotification('success', 'Settings saved successfully');
    } catch (error) {
      showNotification('error', 'Failed to save settings');
    } finally {
      setSaving(false);
    }
  };

  const tabs = [
    {
      label: 'General',
      icon: <SettingsIcon />,
      component: (
        <GeneralSettings
          settings={settings.general}
          onUpdate={(newSettings) => handleSettingsUpdate('general', newSettings)}
        />
      ),
    },
    {
      label: 'Email',
      icon: <EmailIcon />,
      component: (
        <EmailSettings
          settings={settings.email}
          onUpdate={(newSettings) => handleSettingsUpdate('email', newSettings)}
        />
      ),
    },
    {
      label: 'Appearance',
      icon: <PaletteIcon />,
      component: (
        <AppearanceSettings
          settings={settings.appearance}
          onUpdate={(newSettings) =>
            handleSettingsUpdate('appearance', newSettings)
          }
        />
      ),
    },
    {
      label: 'Calendar',
      icon: <CalendarIcon />,
      component: (
        <CalendarIntegration
          settings={settings.calendar}
          onUpdate={(newSettings) =>
            handleSettingsUpdate('calendar', newSettings)
          }
        />
      ),
    },
    {
      label: 'License',
      icon: <VpnKeyIcon />,
      component: (
        <LicenseSettings
          settings={settings.license}
          onUpdate={(newSettings) => handleSettingsUpdate('license', newSettings)}
        />
      ),
    },
    {
      label: 'Advanced',
      icon: <CodeIcon />,
      component: (
        <AdvancedSettings
          settings={settings.advanced}
          onUpdate={(newSettings) =>
            handleSettingsUpdate('advanced', newSettings)
          }
        />
      ),
    },
    {
      label: 'System Info',
      icon: <InfoIcon />,
      component: <SystemInfo />,
    },
  ];

  return (
    <Box>
      <PageHeader
        title="Settings"
        action={
          <Button
            variant="contained"
            onClick={handleSaveSettings}
            disabled={saving}
            startIcon={saving ? <CircularProgress size={20} /> : null}
          >
            {saving ? 'Saving...' : 'Save Settings'}
          </Button>
        }
      />

      <Paper sx={{ mb: 3 }}>
        <Tabs
          value={activeTab}
          onChange={handleTabChange}
          variant="scrollable"
          scrollButtons="auto"
          sx={{ borderBottom: 1, borderColor: 'divider' }}
        >
          {tabs.map((tab, index) => (
            <Tab
              key={index}
              icon={tab.icon}
              label={tab.label}
              id={`settings-tab-${index}`}
              aria-controls={`settings-tabpanel-${index}`}
            />
          ))}
        </Tabs>
      </Paper>

      {tabs.map((tab, index) => (
        <TabPanel key={index} value={activeTab} index={index}>
          {tab.component}
        </TabPanel>
      ))}

      {/* Fixed Save Button */}
      <Box
        sx={{
          position: 'fixed',
          bottom: 0,
          left: 0,
          right: 0,
          bgcolor: 'background.paper',
          borderTop: 1,
          borderColor: 'divider',
          p: 2,
          zIndex: 1000,
          display: activeTab === tabs.length - 1 ? 'none' : 'flex',
          justifyContent: 'flex-end',
        }}
      >
        <Button
          variant="contained"
          onClick={handleSaveSettings}
          disabled={saving}
          startIcon={saving ? <CircularProgress size={20} /> : null}
        >
          {saving ? 'Saving...' : 'Save Settings'}
        </Button>
      </Box>
    </Box>
  );
};

export default Settings;
